# @lc idea=start
#
# 和至少为k的子数组最短长度。
# 滑动窗口。
# 分组，堆叠。
# 对于每个元素，如果其符号与之前相反，那么就新创建一个分组，否则使用之前分组，之后加上自身的值。
# 对于负值，如果此负分组的值大于之前正分组的值，那么这两个分组的和对于滑动窗口是负贡献的，那么就可以将这两个分组与再前面的负分组合并成一个负分组。因为如果滑动窗口的左侧是负值的化，去掉其一定增大了活动窗口的和，当遇到前一个负分组时，一直到此负分组都是负贡献的，都可以去掉。
# 对于左边界，首先循环判断左侧的两个正负分组如果去掉，时候还满足条件，如果满足就去掉。之后循环判断左侧单个正元素，去掉其是否还满足条件。
# 最后计算满足条件时的滑动窗口大小。
#
# @lc idea=end

# @lc group=string

# @lc rank=10


# @lc code=start
class Solution:
    def shortestSubarray(self, nums: List[int], k: int) -> int:
        res = len(nums) + 1
        dp = [[0, -1]]
        f = True
        sum = 0
        leftIdx = -1
        for rightIdx, n in enumerate(nums):
            fn = n > 0
            if fn != f:
                dp.append([0, -1])
                f = fn
            dp[-1][0] += n
            dp[-1][1] = rightIdx
            sum += n
            while not f and dp[-1][0] + dp[-2][0] <= 0:
                # clear
                if len(dp) == 2:
                    f = True
                    dp = [[0, rightIdx]]
                    sum = 0
                    leftIdx = rightIdx
                else:
                    dp[-3][0] += dp[-1][0] + dp[-2][0]
                    dp[-3][1] = rightIdx
                    dp.pop()
                    dp.pop()
            if sum >= k:
                while len(dp) >= 2 and sum - (dp[0][0] + dp[1][0]) >= k:
                    sum -= (dp[0][0] + dp[1][0])
                    leftIdx = dp[1][1]
                    dp.pop(0)
                    dp.pop(0)
                while leftIdx + 1 < rightIdx and sum - nums[leftIdx + 1] >= k:
                    leftIdx += 1
                    sum -= nums[leftIdx]
                    dp[0][0] -= nums[leftIdx]
                res = min(res, rightIdx - leftIdx)

        return res if res <= len(nums) else -1


